class  Banner extends React.Component {

    render() {
        return (

            <div className={classes.box}>

                <div id={classes.heading} className={'p-0 p-sm-5'}>
                    We live to <span className="element"></span>

                </div>
            </div>
        )
    }
}
export default Banner;
